// import Footer from './components/Footer';

class App extends Component{

  render(){
    var product ={
      id : 1,
      name : 'iphone 7 plus',
      price : 200000,
      status : true
    }
    return(
      <div>
        <Header></Header>
        <div className="row">
          <div className="col-xs-5 col-sm-5 col-md-5 col-lg-5">
            {/* <Product></Product> */}
          </div>
          <h3>
         ID: {product.id} <br/>
         ID: {product.name} <br/>
         ID: {product.price} <br/>
         ID: {product.status ? "Actice" : "pending"} <br/>
        </h3>
        </div>
        {/* <Footer></Footer> */}
      </div>
    )
  }
}



export default App;
